import React from "react";
import { connect } from "react-redux";
import './anime-search-list.css'

const AnimeSearchList = ({ animesSearchList }) => {
    console.log("hello")
    console.log(animesSearchList)
    return (
        <div className="lay" onClick={() => document.querySelector('.lay').style.visibility = "hidden"}>
            <div className="searchList d-flex justify-content-start flex-direction-column">
                <div className="outer-container">
                    <div className="inner-container" >
                        {
                            animesSearchList.map((anime) => {
                                return (
                                    <li key={anime.id} className="search-item bg-colour-light border border-dark border-bottom-5">
                                        {anime.name}
                                    </li>
                                )
                            })
                        }
                    </div>
                </div>
            </div>
        </div>
    )
}



const mapStateToProps = ({ animesSearchList }) => {
    return { animesSearchList }

}


export default connect(mapStateToProps)(AnimeSearchList);
